/*!50003 SET sql_mode              = 'STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `add_Key_if_unique`( in `key` char(20),out isUnique boolean)
BEGIN
	declare keyExists boolean default false;
    select distinct true into keyExists from userKeys where `Keys` = `key`;
    if not keyExists then
		insert into userKeys (`Keys`) values (`key`);
        set isUnique = true;
	else
		set isUnique = false;
        select isUnique;
	end if;
END ;;
